  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} /> {/* Ruta por defecto que lleva al Login */}
        <Route path="/dashboard" element={<Dashboard />} /> {/* Ruta para el Dashboard */}
        {/* Otras rutas pueden ser añadidas aquí */}
      </Routes>
    </Router>
  );
}

